import React, { Component } from 'react';
import CardClass from './CardClass';

class ACard extends Com {
  constructor(props) {
    super(props)
    this.state = {
      value:'click me'
    }    
  }

  setValue = () => this.state.value

  render() {
    return <CardClass value={this.setValue}></CardClass>
  }

}

export default ACard;
